    const appId = "63326c6fc50edca9bc452318";
    const onLogin = (userInfo) => {
        window.location.token = userInfo.token;
        window.location.tokenExpiredAt = userInfo.token
        console.log(userInfo);
        window.location.reload();
    }
    return <Guard appId={appId} onLogin={onLogin}/>
}
